import React from "react";
import { NavLink } from "react-router-dom";
import web from "../src/image/launcher.svg";
const Home = () =>{
    return (
        <>
            <section id="header" className="">
                <div className="container-fluid">

                <div className="row">

                <div className="col-10 mx-auto">



                    <div className="row">
                        
                        <div className="col-md-6 pt-5 pt-lg-0 order-2 order-lg-1">
                            <h1>Build Your Website With <strong>Technical Abhishek</strong></h1>
                            <h2>Boost Your Buisness With High Quality Website designs</h2>

                           <div className="btn">
                            <button><NavLink to="/service" activeClassName="getStartedBtn">Get Started</NavLink></button> 
                           </div> 
                       
                        </div>


                        <div className="col-lg-6 order-1 order-2 "></div>
                            <img src={web} className="img-fluid" alt="no img" />
                        </div>



                </div>

                </div>

                </div>
            </section>
        </>
    )
}

export default Home;













